import React from "react";

const Product = (props) => {

  const { product } = props







  return props.product === null ? (
    "Loading"
  ) : (
    <tr className="border-8 border-l-4 border-r-4 border-white">
      <td className="hidden pt-4 pb-4 md:table-cell">
        <div>
          <img
            src={`http://localhost:8000/storage/images/products/${product.image}`}
            className="w-20 rounded"
            alt="Thumbnail"
          />
        </div>
      </td>
      <td className="hidden pt-4 pb-4 md:table-cell">{product.title}</td>
      <td className="hidden pt-4 pb-4 md:table-cell">{product.price}</td>
      <td className="hidden pt-4 pb-4 md:table-cell">{product.deduction}</td>
      <td className="hidden pt-4 pb-4 md:table-cell">{product.qty}</td>
      <td className="flex pt-4 pb-4 md:table-cell">
        <i className="fa fa-pen text-md font-semibold"></i>
        <i className="fa fa-trash text-md font-semibold"></i>
      </td>
    </tr>
  );
};

export default Product;
